import { useNavigate } from 'react-router-dom';

const Home = ({ user }) => {
  const navigate = useNavigate();

  // Check if user is not authenticated, then navigate to login
  if (!user) {
    navigate('/login');
    return null; // Return null to avoid rendering anything for unauthorized users
  }

  return (
    <div>
      <h2>Welcome, {user.username}!</h2>
      {/* Display authenticated content here */}
    </div>
  );
};

export default Home;
